import './App.css';
import LoginLayout from './pages/LoginLayout';
import { Switch, Route } from 'react-router-dom';

const App=()=> {
  return (
    <div className="App">
    <Switch>
    <Route exact path='/' render={props => <DashboardLayout {...props}/>}/>
    <Route path='/login'  render={ <LoginLayout/>}/>
    </Switch>
    </div>
  );
}

export default App;
